<?php

namespace Database\Seeders;

use Illuminate\Database\Console\Seeds\WithoutModelEvents;
use Illuminate\Database\Seeder;
use App\Models\category;

class categorySeeder extends Seeder
{
    public function run(): void
    {
        $categorys = [
            ['Category_name' => "Painkillers", 'Arabic_Category_name' => "مسكنات", 'image' => ""],
            ['Category_name' => "Antibiotics", 'Arabic_Category_name' => "مضادات حيوية", 'image' => ""],
            ['Category_name' => "Heart medications", 'Arabic_Category_name' => "أدوية قلبية", 'image' => ""],
            ['Category_name' => "Diabetes medications", 'Arabic_Category_name' => "أدوية السكري", 'image' => ""],
            ['Category_name' => "Muscle relaxant", 'Arabic_Category_name' => "مرخي عضلي", 'image' => ""],
            ['Category_name' => "Tranquilizers", 'Arabic_Category_name' => "مهدئات", 'image' => ""],
            ['Category_name' => "Antidepressants", 'Arabic_Category_name' => "مضادات اكتئاب", 'image' => ""]
        ];
        foreach ($categorys as $category) {
            $image = base64_decode($category['image']);
            $extension = ".jpg"; //. $extension;
            $path = "/images/" . $category['Category_name'] . $extension;
            file_put_contents(public_path($path), $image);
            $category['image'] = $path;
            category::create($category);
        }
    }
}
